#初始化数组
def readFile(langSetting):
        if os.path.exists('myid.txt'):
                id_list = []
                for line in open('myid.txt'):
                        line = line.strip('\n')
                        id_list.append(line)
                return id_list
        else:
            if langSetting == 'cn':
                input('错误，文件myid.txt不存在！')
            else:
                input('Error, myid.txt is not exist!')

#检查并返回错误码
def checkId(cid, thisYear):
    #非法字符检查
    for i in range(0,16):
        if not(cid[i].isdigit()):
            return 1
    if cid[17] != 'X' and not(cid[17].isdigit()):
        return 1
    #位数检查
    if len(cid) != 18:
        if len(cid) == 15:
            return 3
        else:
            return 2
    #区号检查（初筛）
    if int(cid[0:2]) > 82 or int(cid[2:4]) >70:
        return 4
    else:
        #这里加入二筛和区号查询
        global areaInfo
        areaInfo = checkArea(cid[0:6])
        if areaInfo == 'error':
            return 4
    #生日检查
    idYear = int(cid[6:10])
    idMonth = int(cid[10:12])
    idDay = int(cid[12:14])
    if idYear < thisYear - 150 or idYear > thisYear:
        return 5
    if idMonth == 0 or idMonth > 12 or idDay == 0:
        return 5
    else:
        if idMonth in [1,3,5,7,8,11,12] and idDay > 31:
            return 5
        elif idMonth in [4,6,9,10] and idDay > 30:
            return 5
        else:
            if idMonth == 2 and idDay >29:
                return 5
            elif idMonth == 2 and idDay == 29:
                if idYear%4 != 0 or idYear%100 == 0:
                    return 5
    #校验码检查
    if cid[17] == 'X' or cid[17] == 'x':
        str18 = 10
    else:
        str18 = int(cid[17])
    checkNum = int(cid[0])*7 + int(cid[1])*9 + int(cid[2])*10 + int(cid[3])*5 +\
    int(cid[4])*8 + int(cid[5])*4 + int(cid[6])*2 + int(cid[7]) + int(cid[8])*6 +\
    int(cid[9])*3 + int(cid[10])*7 + int(cid[11])*9 + int(cid[12])*10 + int(cid[13])*5 +\
    int(cid[14])*8 + int(cid[15])*4 + int(cid[16])*2
    checkNum = checkNum % 11 + str18
    if checkNum != 12 and checkNum != 1:
        return 6
    return 0
    
def checkMain():
    runcode = input('请将身份证号1行1个存为myid.txt并放在本脚本同一目录下，按下回车键开始。\n\
Please save IDs line by line as "myid.txt" and put the file in the same floder as this\
script. For using English language, please enter "en" or "En" and type Enter.')
    global langSetting
    langSetting = 'cn'
    if runcode == 'en' or runcode == 'En':
        langSetting = 'en'
    id_list = readFile(langSetting)
    thisYear = int(time.strftime("%Y"))
    count = 0
    writeFile = open('myid-checked.csv','w')
    newLine = 'idChecking'
    global areaWarningFlag
    areaWarningFlag = 0
    if langSetting == 'cn':
        headInfo = '编号,地区,性别,身份证号,生日,检验结果,错误代码'
    else:
        headInfo = 'No,Area,Sex,Id,Birthday,Check Result,Error Code'
    writeFile.write(headInfo+'\n')
    global areaInfo
    for cid in id_list:
        areaInfo = 'error'
        count += 1
        checkCode = checkId(cid, thisYear)
        if checkCode == 0:
            birthDay = cid[6:10]+'-'+cid[10:12]+'-'+cid[12:14]
            if langSetting == "cn":
                newLine = '{},{},{},{},{},正确,/'.format(count,areaInfo,sex_code_cn[int(cid[16])%2],cid,birthDay)
            else:
                newLine = '{},{},{},{},{},Right,/'.format(count,areaInfo,cid,sex_code_en[int(cid[16])%2],birthDay)
        else:
            if langSetting == "cn":
                newLine = '{},/,{},/,/,错误,{}'.format(count,cid,error_code_cn[checkCode])
            else:
                newLine = '{},/,{},/,/,Wrong,{}'.format(count,cid,error_code_en[checkCode])
        writeFile.write(newLine+'\n')
    writeFile.close()
    print('\n\n\n')
    if langSetting == 'cn':
        if areaWarningFlag:
            print('※请注意，{}个身份证的地区代码不在当前有效区号内，这可能是因为区号更新引起的，并不必然代表错误。\
缺少区和县的地区代码已经用[!]和[?]标注。\n'.format(areaWarningFlag))
        input('检查完成，共检查了{}个身份证号，请用Excel或文本编辑器打开myid-checked.csv。'.format(count))
    else:
        if areaWarningFlag > 1:
            print('※Warning: Please note that {} IDs have undefined Area Codes. That may not mean wrong ID numbers,\
Because the Area Code List is updating every month. Those IDs have been marked with [!] and [?].'.format(areaWarningFlag))
        elif areaWarningFlag == 1:
            print('※Warning: Please note that 1 ID has an undefined Area Code. That may not mean a wrong ID number,\
Because the Area Code List is updating every month. That ID has been marked with [!] or [?].')
        if count > 1:
            input('{} IDs checked, please open "myid-checked.csv" with Microsoft Excel or TXT Editors.'.format(count))
        else:
            input('1 ID checked, please open "myid-checked.csv" with Microsoft Excel or TXT Editors.')

def checkArea(areaCode):
    global langSetting
    areaCode = int(areaCode)
    areaCode1 = int(areaCode/100)*100
    areaCode2 = int(areaCode/10000)*10000
    warning = ''
    global areaWarningFlag
    if langSetting == 'cn':
        if areaCode in areaList.keys():
            if areaCode2 in areaList.keys() and areaCode != areaCode2:
                areaInf = areaList[areaCode2] + areaList[areaCode]
            else:
                areaInf = areaList[areaCode]
        elif areaCode1 in areaList.keys():
            if areaCode2 in areaList.keys() and areaCode1 != areaCode2:
                areaInf = areaList[areaCode2] + areaList[areaCode1]
            else:
                areaInf = areaList[areaCode1]
            warning = '[!]'
            areaWarningFlag += 1
        elif areaCode2 in areaList.keys():
            areaInf = areaList[areaCode2]
            warning = '[?]'
            areaWarningFlag += 1
        else:
            return 'error'
    else:
        if areaCode in areaListEn.keys():
            if areaCode2 in areaListEn.keys() and areaCode != areaCode2:
                areaInf = areaListEn[areaCode] +'-'+ areaListEn[areaCode2]
            else:
                areaInf = areaListEn[areaCode]
        elif areaCode1 in areaListEn.keys():
            if areaCode2 in areaListEn.keys() and areaCode1 != areaCode2:
                areaInf = areaListEn[areaCode1] +'-'+ areaListEn[areaCode2]
            else:
                areaInf = areaListEn[areaCode1]
            warning = '[!]'
            areaWarningFlag += 1
        elif areaCode2 in areaListEn.keys():
            areaInf = areaListEn[areaCode2]
            warning = '[?]'
            areaWarningFlag += 1
        else:
            return 'error'
    return areaInf + warning

